  [],\n\t\"revision_timestamp\": \"2016-05-25T00:20:17.161038\",\n\t\"name\": \"ai-driver-information-resource\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Driver Information Resource (DIR) provides
  a web based lookup capability that allows FMCSA and State enforcement personnel
  to search, via a secure password, crash and inspection history by driver name or
  commercial driver license number. Crash and/or violation data will be displayed
  if the driver had an inspection within 3 years or a crash within 5 years. All crash
  and inspection events that meet these criteria will be included and associated with
  both the driver and motor carrier for whom they were operating. The system will
  also allow users to search by U.S. DOT number or carrier name to obtain a list of
  all drivers affiliated with the specified carrier that had an inspection within
  3 years or a crash within 5 years.\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
